const Radar = () => {
  return (
    <div>
    <iframe style="display: block; aspect-ratio: 16/9; margin: 0px auto; width:70%; text-align: center;" title="ITONICS Cloud" xml="lang" src="https://teaser.itonics.io/radar/trendRadar?zoomonscroll=false&amp;cantogglezoom=true" name="iFrame" data-service="teaser.itonics"></iframe>
    </div>


  )
}

export default Radar
